int ToggleActiveRightManualArrow = 0;

int ActiveLeftAutomaticArrow = 0;
int ActiveRightAutomaticArrow = 0;
int ActiveLeftManualArrow = 0;
int ActiveRightManualArrow = 0;
int ActiveBrakeLight = 0;

int timeoutcount = 0;

void addToScreen(char toAdd[32][128])
{
    int i, j;
    for (i = 0; i < 32; i++)
    {
        for (j = 0; j < 128; j++)
        {
            if (toAdd[i][j] == 1)
            {
                Screen[i][j] = 1;
            }
        }
    }
}

void removeFromScreen(char toRemove[32][128])
{
    int i, j;
    for (i = 0; i < 32; i++)
    {
        for (j = 0; j < 128; j++)
        {
            if (toRemove[i][j] == 1)
            {
                Screen[i][j] = 0;
            }
        }
    }
}

void update_screen()
{
    translate_image(Screen);
    render_image(DrawingScreen);
}

void clearScreen()
{
    int i, j;
    for (i = 0; i < 32; i++)
    {
        for (j = 0; j < 128; j++)
        {
            Screen[i][j] = 0;
        }
    }
}

void debug_image(char toDebug[32][128])
{
    int i, j;
    printf("\n");
    for (i = 0; i < 32; i++)
    {
        for (j = 0; j < 128; j++)
        {
            if (toDebug[i][j] == 1)
            {
                printf(" ");
            }
            else
            {
                printf("#");
            }
        }
        printf("\n");
    }
}

